  const tab = useMediaQuery("(max-width:1023px)")
  return (
    <div>
        <CameraIcon style={{fontSize:"50px",color:"purple"}}/>
        <Button variant="contained" size="large" color="default">Hello</Button>

        {
          tab===false && 
          <div>
            Mobile
          </div>
        }
        {/* Mobile : {mob.toString()}
        Tablet : {tab.toString()} */}
    </div>
  )
}

export default Mui
